import React, { Component } from 'react';
import './app.css';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';
import Container from "react-bootstrap/Container";

class App extends Component {
    render() {
        let div = <p>Hello World</p>;
        return (
            <Container>
                <Row>
                    <Col xs={{ span: 8, offset: 2 }} className="wrapper">
                        <Row>
                            <Col xs={12} className="red">
                                <Navbar expand="md">
                                    <Navbar.Brand>Bulk Mailer</Navbar.Brand>
                                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                                    <Navbar.Collapse id="basic-navbar-nav" className="justify-content-md-end justify-content-center">
                                        <Button variant="outline-dark">Create Template</Button>
                                        <Button variant="outline-dark">Send Mails</Button>
                                    </Navbar.Collapse>
                                </Navbar>
                            </Col>
                            <Col xs={12} className="blue">
                                {div}
                            </Col>
                        </Row>
                    </Col>
                </Row>
            </Container>
        );
    }
}

export default App;
